class TransitionTable {
  object Id {
    var string : String = ""

    def jumpSymbol1 = {
      string += ch
      newState = 58
    }
    def jumpSymbol2 = {
      outArray += new Word(string, Tag.ID)
      newState = 0
      string = ""
    }
    def jumpSymbol3 = {
      outArray += new Word(string, Tag.ID)
      outArray += new Word(""+ch, ch)
      newState=0
      string =""
    }
  }

  object Integer {
    var value: Int = 0

    def jumpDigit1 = {
      value = value * 10
      value += ch.asDigit
      newState = 57
    }
    def jumpDigit2 = {
      outArray += new Word(value.toString,Tag.INTEGER)
      newState= 0
      value = 0
    }
    def jumpDigit3 = {
      outArray += new Word(value.toString,Tag.INTEGER)
      outArray += new Word(""+ch,ch)
      newState= 0
      value = 0
    }
  }


  var outArray =  ArrayBuffer[Word]()
  var newState: Int = 0
  var ch: Char = ' '
  var semeanticTable = Map(
    -1 -> jumpErrorState _,
    -2 -> jumpSYMBOL _,
    -3 -> jumpVARCONST _,
    -4 -> jumpPROGRAMM _,
    -5 -> jumpVARIABLE _,
    -6 -> jumpOUTPUT _,
    -7 -> jumpINPUT _,
    -8 -> jumpIF _,
    -20 ->jumpIF2 _,
    -9 -> jumpESLE _,
    -10-> jumpCONSTANT _,
    -11 -> jumpWHILE _,
    -19 -> jumpWHILE2 _,
    -12 -> jumpARRAY _,
    58 -> Id.jumpSymbol1 _,
    -14 -> Id.jumpSymbol2 _,
    -15 -> Id.jumpSymbol3 _,
    57 -> Integer.jumpDigit1 _,
    -17 -> Integer.jumpDigit2 _,
    -18 -> Integer.jumpDigit3 _
  )


  def jumpSYMBOL =   { newState = 0; outArray += new Word("" + ch, ch.toInt)}
  def jumpVARCONST = { newState = 0; outArray += new Word("ВАРКОНСТ",Tag.VARCONST) }
  def jumpPROGRAMM = { newState = 0; outArray += new Word("ПРОГРАММА",Tag.PROGRAMM)}
  def jumpVARIABLE = { newState = 0; outArray += new Word("ПЕРЕМЕННАЯ",Tag.VARIABLE) }
  def jumpOUTPUT =   { newState = 0; outArray += new Word("ВЫВОД",Tag.OUTPUT) }
  def jumpINPUT =    { newState = 0; outArray += new Word("ВВОД",Tag.INPUT) }
  def jumpIF =       { newState = 0; outArray += new Word("ЕСЛИ",Tag.IF) }
  def jumpIF2 =      { newState = 0; outArray += new Word("ЕСЛИ",Tag.IF); outArray += new Word("(",40)}
  def jumpESLE =     { newState = 0; outArray += new Word("ИНАЧЕ",Tag.ELSE) }
  def jumpCONSTANT = { newState = 0; outArray += new Word("КОНСТ",Tag.CONSTANT) }
  def jumpWHILE =    { newState = 0; outArray += new Word("ПОКА",Tag.WHILE) }
  def jumpWHILE2 =   { newState = 0; outArray += new Word("ПОКА",Tag.WHILE); outArray += new Word("(",40)}
  def jumpARRAY =    { newState = 0; outArray += new Word("МАССИВ",Tag.ARRAY) }
  def jumpErrorState={ throw new Exception("Ошибка лексического анализатора") }


  def move(state: Int,char: Int) = {
    var exist: Boolean = false
    for (j <- 1 until TransitionTable.cols) {
      if (TransitionTable.t(0)(j) == char) {
        newState = TransitionTable.t(state+1)(j)
        exist = true
      }
    }
    if (exist == false) jumpErrorState
    if (semeanticTable.contains(newState)) semeanticTable(newState)()
  }
}



